  \"Nesting ecology and habitat requirements of geese at Kokechik Bay, Yukon-Kuskokwim
  Delta, Alaska: Annual report\",\n\t\"tracking_summary\": {\n\t\t\"total\": 1,\n\t\t\"recent\":
