  \"2016-07-27T23:01:59.609937\",\n\t\"name\": \"nesting-ecology-and-habitat-requirements-of-geese-at-kokechik-bay-yukon-kuskokwim-delta-al\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"Presents the second year of a five year
  study on the breeding biology and habitat requirements of geese nesting at Kokechik
  Bay from 6 May to 1 July 1983. The primary objective of this field season was to:
  1. begin a study on the behavior of cackling Canada (Branta canadensis minima) and
  emperor geese (Anser canagicus) in spring; 2. to continue the study of the comparative
  nesting ecology of geese; 3. to continue the study of the adaptive significance
  of clutch size in emperor geese; and 4. to begin the study of the incubation behavior
  of geese.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\": [{\n\t\t\"key\":
